import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import WordList from './components/WordList';
import WordDetails from './components/WordDetails';
import AddWordForm from './components/AddWordForm';
import TopSearches from './components/TopSearches';
import SearchByTag from './components/SearchByTag';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Dictionary Application</h1>
        <nav>
          <Link to="/">Home</Link> | 
          <Link to="/add-word"> Add Word</Link> | 
          <Link to="/top-searches"> Top Searches</Link> | 
          <Link to="/search-by-tag"> Search by Tag</Link>
        </nav>
        <Switch>
          <Route exact path="/" component={WordList} />
          <Route path="/word/:word" component={WordDetails} />
          <Route path="/add-word" component={AddWordForm} />
          <Route path="/top-searches" component={TopSearches} />
          <Route path="/search-by-tag" component={SearchByTag} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
